import React from "react";

const PremiumConsult = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-black text-white p-10 animate-fadeIn">
      <h1 className="text-5xl font-bold text-yellow-400 mb-6">ðŸŒŸ Premium Astrology Consultation</h1>
      <p className="text-lg max-w-3xl text-center mb-10">
        Get personalized astrology guidance from top astrologers. Choose your session type and book now!
      </p>

      {/* Session Types */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {["Basic Reading", "Deep Analysis", "Life Path Consultation"].map((session, index) => (
          <div key={index} className="p-6 bg-gray-800 border border-yellow-500 rounded-lg text-center hover:scale-105 transition">
            <h2 className="text-2xl font-bold">{session}</h2>
            <p className="mt-4 text-gray-400">30 min session</p>
            <button className="mt-4 px-6 py-3 bg-yellow-500 text-black rounded-full hover:bg-yellow-600 transition">
              Book Now
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PremiumConsult;
